import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

function App() {
  let post = "Jordan 3";
  let [titles, setTitles] = useState([
    "ÎÇ®ÏûêÏΩîÌä∏ Ï∂îÏ≤ú",
    "Í∞ïÎÇ® Ïö∞ÎèôÎßõÏßë",
    "ÌååÏù¥Ïç¨ ÎèÖÌïô",
  ]);
  let [likes, setLikes] = useState([0, 0, 0]);

  let [modal, setModal] = useState(false);

  return (
    <div className="App">
      <div className="black-nav">
        <h4>GirlsDo</h4>
      </div>
      <button
        onClick={() => {
          let copy = [...titles];
          copy = copy.sort();
          setTitles(copy);
        }}
      >
        Alphabetical Order
      </button>

      {modal == true ? <Modal /> : null}

      {titles.map(function (title, i) {
        return (
          <div className="list" key={i}>
            <h4>
              {title}{" "}
              <span
                onClick={() => {
                  let copy = [...likes];
                  copy[i] += 1;
                  setLikes(copy);
                }}
              >
                üëç
              </span>{" "}
              {likes[i]}
            </h4>
            <p>2nd February Published</p>
          </div>
        );
        {
          modal == true ? <Modal /> : null;
        }
      })}
    </div>
  );
}

function Modal() {
  return (
    <div className="modal">
      <h4>Title</h4>
      <p>Date</p>
      <p>Details</p>
    </div>
  );
}

export default App;
